import fetch from 'isomorphic-unfetch'; // For fetch API
import Head from 'next/head';
// import { Component } from 'react';
// import Link from 'next/link';
// import Layout from './MyLayout';
// import { post } from 'axios';

export default class InstructorSchedule extends React.Component {
	constructor(props) {
		super(props);
	}

	render() {
		console.log('Prop is ' + this.props.value);
		console.log('Prop is ' + this.props.timeslot);

		return (
			<div>
				<Head>
					<title>Yoga Kickstarter</title>
					<link
						rel="stylesheet"
						href="https://stackpath.bootstrapcdn.com/bootstrap/4.3.1/css/bootstrap.min.css"
					/>
				</Head>
				<div className="container">
					<h2>Congratulations, you have chosen {this.props.value}</h2>
				</div>
				<h1>{this.props.value}</h1>
				<h1>{this.props.timeslot}</h1>
			</div>
		);
	}
}
